bool check_game_over() {
  // check if the board has any empty spots -> game over is false
  // check if there are any adjacent same numbers -> game over is false
  // otherwise game over is true

  for (int i = 0 ; i < 4; i++) {
    for (int j = 0; j < 4; j++) {

      if (board[i][j] == 0) {
          return false;
      } 

      if (j < 3) {
        if (board[i][j] == board[i][j+1]) {
          return false;
        }
      }

      if (i < 3) {
        if (board[i][j] == board[i+1][j]) {
          return false;
        }
      }

    }
  }

  return true;
}

// poll for user input on KEY3-0
int get_user_input() {
  unsigned char byte1 = 0;
  unsigned char byte2 = 0;
  unsigned char byte3 = 0;

  volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

  int PS2_data, RVALID;
  bool valid_input = false;

  while (!valid_input) {
   	PS2_data = *(PS2_ptr);    // read the Data register in the PS/2 port
   	RVALID = (PS2_data & 0x8000);    // extract the RVALID field
   	if (RVALID != 0){
   		/* always save the last three bytes received */
   		byte1 = byte2;
   		byte2 = byte3;
   		byte3 = PS2_data & 0xFF;
   	}
   	
    if ( (byte2 == 0xf0) && (byte3 == 0x75) ) {
      valid_input = true;
   		return 0;
   	} else if ( (byte2 == 0xf0) && (byte3 == 0x72) ) {
      valid_input = true;
   		return 1;
   	} else if ( (byte2 == 0xf0) && (byte3 == 0x6b) ) {
      valid_input = true;
   		return 2;
   	} else if ( (byte2 == 0xf0) && (byte3 == 0x74) ) {
      valid_input = true;
   		return 3;
   	}
  }
}

