void plot_pixel(int x, int y, short int color) {
  *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = color;
}

void wait_for_vsync() { 
  volatile int * pixel_ctrl_ptr = (int *) 0xFF203020; // DMA
  
  int status;
  
  *pixel_ctrl_ptr = 1; // start the synchronization process
  
  status = *(pixel_ctrl_ptr + 3);
  
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3); 
  }
}

int check_zeros() {

    int counter = 0;
    
    // make an array with the x, y positions of the zeros
    for (int i = 0 ; i < 4; i++) {
        for (int j = 0; j < 4; j++) {
            if (board[i][j] == 0) {
                zeros[counter][0] = i;
                zeros[counter][1] = j;
                counter++;
            }
        }
    }
    
   return counter;
}

// randomly generate blocks
void generate_blocks(int highest) {
    
    // check where there are zeros
    int count = check_zeros();

    // randomly generate a number to index the array
    int random_one = 0; 
    int random_two = 0; 
    
    // start of the game, generate 2 1 blocks
    if (highest == 1) {
        while (random_one == random_two) {
            // generate a random number from 0 to count - 1
            random_one = rand() % count; 
            random_two = rand() % count;
        }
        
        board[zeros[random_one][0]][zeros[random_one][1]] = 1;
        board[zeros[random_two][0]][zeros[random_two][1]] = 1;
    } 
    // generate 1 block of 1 or 2
    else {
        
        // generate a random number from 1 - 2
        random_one = rand() % (2 - 1) + 1; 
        
        // generate a random number from 0 to count - 1
        random_two = rand() % count;
        
        board[zeros[random_two][0]][zeros[random_two][1]] = random_one;
    } 
	draw_board_change();
}

void move_blocks(int dir) {
    
    int move_x;
    int move_y;
    int column = 0;
    // move right
    if (dir == 0) {
        move_x = 1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 0; col < 3; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
                    board[row + move_y][col + move_x] = board[row][col];
						move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                        board[row][col] = 0;
						
                    }
                }
            }
        }
  
    } 
    // move left
    else if (dir == 1) {
        move_x = -1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 3; col > 0; col --) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
					   move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                       board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;						
                    }
                }
            }
        }
    } 
    // move down
    else if (dir == 2) {
        move_x = 0;
        move_y = 1;
        
        for (int row = 0; row < 3; row ++) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
				      move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                      board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;						
                    }
                }
            }
        }
    } 
    // move up
    else {
        move_x = 0;
        move_y = -1;
        
        for (int row = 3; row > 0; row --) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
					 move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                     board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;
						
                    }
                }
            }
        }
    }
	draw_board_change();
}

void merge(int dir, int highest) {
    // check if next block is the same number, if it is merge
    // check if merged number is larger than highest number

    int move_x;
    int move_y;
    
    // move right
    if (dir == 0) {
        move_x = -1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 3; col >= 0; col --) {
                if (board[row][col] != 0) {
                    if (board[row][col] == board[row + move_y][col + move_x]) {
                      board[row + move_y][col + move_x] = board[row][col]*2;
                      board[row][col] = 0;

                      if (board[row][col]*2 > highest) {
                        highest = board[row][col]*2;
                      }
                    }
                }
            }
        }
  
    } 
    // move left
    else if (dir == 1) {
        move_x = 1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 0; col < 3; col ++) {
                if (board[row][col] != 0) {
                    if (board[row][col] == board[row + move_y][col + move_x]) {
                      board[row + move_y][col + move_x] = board[row][col]*2;
                      board[row][col] = 0;

                      if (board[row][col]*2 > highest) {
                        highest = board[row][col]*2;
                      }
                    }
                }
            }
        }
    } 
    // move down
    else if (dir == 2) {
        move_x = 0;
        move_y = -1;
        
        for (int row = 3; row > 0; row --) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row][col] == board[row + move_y][col + move_x]) {
                      board[row + move_y][col + move_x] = board[row][col]*2;
                      board[row][col] = 0;

                      if (board[row][col]*2 > highest) {
                        highest = board[row][col]*2;
                      }
                    }
                }
            }
        }
    } 
    // move up
    else {
        move_x = 0;
        move_y = 1;
        
        for (int row = 0; row < 3; row ++) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row][col] == board[row + move_y][col + move_x]) {
                      board[row][col] = board[row + move_y][col + move_x]*2;
                      board[row + move_y][col + move_x] = 0;
                    }
                }
            }
        }
    }
	draw_board_change();
}

